function WorkExp(){
    const [data, setData] = useState(null);
    const columnNames=[
        "Order",
        "CompanyName",
        "Experience",
        "Position"
      ];

    useEffect(() => {
      fetch('https://mocki.io/v1/e0440544-4ef9-4a94-9729-ea4ccd0b3250')
        .then(response => response.json())
        .then(json => setData(json))
        .catch(error => console.error(error));
    }, []);

    return (
        <div>
           {data ? <pre>{JSON.stringify(data, null, 2)}</pre> : 'Loading...'}
           {/* <WorkExpFormatted data={data? data:[]}/> */}
<table>
<thead>
    {
        columnNames.map(cname=>{
           return( 
            <td>{cname}</td>
           )
        })
    } </thead>
<tbody>{
data && data.length ? data.map(ele=>{
   return( <tr>
    <td>{ele.sno}</td>
    <td>{ele.CompanyName}</td>
    <td>{ele.position}</td>
    <td>{ele.yearrange}</td>
    </tr>)
}) : ""
}</tbody>
</table>
        </div>

    )
}

export default WorkExp
